function About(){
    return(
        <div>
            <div></div>
            <div>I am currently pursuing a B.Tech in Computer Science with a specialization in Cloud Computing and Machine Learning
                 from Babu Banarasi Das University, Lucknow. I'm passionate about learning new and advancing technologies and implement them 
                 to solve real-world problems. I'm eager to apply my knowledge and skills () to solve real-world problems. I'm looking 
                  forward to seeking internship opportunities in the Software Development domain to gain practical experience and contribute
                   to meaningful projects.
            </div>
        </div>
    );
}

export default About;
